lutParams.precision = precision;

关于FP16：16bit = 1bit 符号位(S) + 5bit 指数位(E) + 10bit 精度位(M)，计算公式如下：
V=\begin{cases}(-1)^s \times 0.0, &amp;E=0,M=0 \\(-1)^s \times 2^{-14} \times \frac{M}{2^{10}}, &amp;E=0,M\not=0 \\(-1)^s \times 2^{E-15} \times (1+\frac{M}{2^{10}}), &amp; 0&lt;E&lt;31 \\ (-1)^s \times Inf, &amp; E=31,M=0 \\ Nan, &amp;E=31,M\not=0\end{cases}
当x=0时， y=0.5, 0.5的FP16即为0x3800
